function formatDate(date){

	if($.type(date)==="date"){
		var _m = String(date.getMonth()+1);
		var _d = String(date.getDate());
		_m = _m.length==2?_m:"0"+_m;
		_d = _d.length==2?_d:"0"+_d;
		return String(date.getFullYear()) + _m + _d;
	}
	return 0;
}



